import React from 'react';
const ArticlesList = () => {
    const getArticles = async() => {
        const result = await fetch(
            `/api/articles/all`,
            {method:'post',}
        );
        return await result.json();
    }

    const articles = getArticles();
    alert(articles);

    return(
        <React.Fragment>
            <h1>Pages</h1>

        </React.Fragment>
    )
}

export default ArticlesList;
